import React from 'react';
import {
    Link, useNavigate
} from 'react-router-dom';
const Nav = () => {
    const auth = localStorage.getItem('user');
    const navigate = useNavigate();
    const logout = () => {
        localStorage.clear();
        navigate('/signup')
    }
    return (
        <div>
            <img
            alt='logo'
            className='logo'
             src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fres.cloudinary.com%2Fhilnmyskv%2Fimage%2Fupload%2Fq_70%2Cf_auto%2Fv1666814448%2FAlgolia_com_Blog_assets%2FFeatured_images%2Fecommerce%2Fcomparing-the-best-ecommerce-search-solutions%2Fi2hsnhx9r9nlqt0030mr.png&imgrefurl=https%3A%2F%2Fwww.algolia.com%2Fblog%2Fecommerce%2Fcomparing-the-best-ecommerce-search-solutions%2F&tbnid=_p322srCzWIO5M&vet=10CHcQMyieAWoXChMIiLOJx_i8-wIVAAAAAB0AAAAAEAM..i&docid=NslWPdFR4BdQsM&w=1441&h=801&q=ecommerce&ved=0CHcQMyieAWoXChMIiLOJx_i8-wIVAAAAAB0AAAAAEAM' />
            {
                auth ?

                    <ul className="nav-ul">
                        <li><Link to="/">Products</Link></li>
                        <li><Link to="/add">Add Products</Link></li>
                        <li><Link to="/update"> Update Products</Link></li>
                        <li><Link to="/profile">Profile</Link></li>
                        <li> <Link onClick={logout} to="/signup">Logout ({ JSON.parse(auth).name})</Link></li>
                    </ul>
                    :
                    <ul className="nav-ul nav-right">
                        <li> <Link to="/signup">Sign Up</Link></li>
                        <li><Link to="/login">Login</Link></li>
                    </ul>
            }


        </div>
    )
}

export default Nav;
